    const [editing,setEditing] = useState(false)
    const [addnew, setNew] = useState(false)
    function NewFunc(){
        setNew(true)
    }
    return(
    <div className='addNew'>
        {(editing==false && addnew==false) ==true?(
        <>
        <div className='HeaderPanel'>Здравствуйте, администратор</div>
        <button className='submitadmin'>Удалить или редактировать</button>
        <button className='submitadmin' onClick={NewFunc}>Добавить новость</button>
        </>
    ):editing ? (<Spisok/>): addnew ? (
        <>
        <div className='HeaderPanel'>Добавить новость</div>
        <input id= 'name' placeholder='Введите название' type='text'></input>
        <textarea id = 'discription' placeholder='Введите описание'></textarea>
        <button className='submitadmin'>Загрузить новость</button>
        </>):(<></>)}
    </div>)
}
function Spisok(){
    const [spisok, setSpisok] = useState([])
    return(<div>попа</div>)
}
